            },
            {
                id: 4,
                title: 'item 4',
            }
        ],
        name: 'App Component',
        desc: 'This is App Comp....',
    }
    render() {
            // console.log(this.state.name);
            return ( <
                div className = "App" > <
                Header title = "Header Component"
                desc = "This is Header Comp..."
                newData = { this.state.desc }
                / >
                Content.... {
                    this.state.products.map((prod, i) =>
                        <
                        div key = { prod.id } > { prod.title }; <
                        /div>)} <
                        Footer title = "Footer Component" / > <
                        /div>
                    );
                }
            }

            export default App;
